-- Table structure for oneapm_alarm_info
-- ----------------------------
DROP TABLE IF EXISTS `oneapm_alarm_info`;
CREATE TABLE `oneapm_alarm_info` (
  `BelongXiaQuCode` varchar(50) DEFAULT NULL,
  `OperateUserName` varchar(50) DEFAULT NULL,
  `OperateDate` date DEFAULT NULL,
  `Row_ID` int(11) DEFAULT NULL,
  `YearFlag` varchar(4) DEFAULT NULL,
  `RowGuid` varchar(50) NOT NULL,
  `visible_name` varchar(128) DEFAULT NULL,
  `target` varchar(128) DEFAULT NULL,
  `compare` varchar(50) DEFAULT NULL,
  `right_value` varchar(1024) DEFAULT NULL,
  `type` varchar(40) DEFAULT NULL,
  `res_uuid` varchar(100) DEFAULT NULL,
  `is_default` int(11) DEFAULT NULL,
  `default_uuid` varchar(50) DEFAULT NULL,
  `metric` varchar(255) DEFAULT NULL,
  `max_step` int(11) DEFAULT NULL,
  `notify_uuid` longtext,
  `alarm_user` longtext,
  `alarm_enable` varchar(50) DEFAULT NULL,
  `alarm_level` varchar(50) DEFAULT NULL,
  `alarm_state` int(11) DEFAULT NULL,
  `res_name` varchar(50) DEFAULT NULL,
  `mng_ip` varchar(255) DEFAULT NULL,
  `sys_guid` varchar(50) DEFAULT NULL,
  `chk_url_suffix` varchar(50) DEFAULT NULL,
  `unit` varchar(50) DEFAULT NULL,
  `lastalarmdate` datetime DEFAULT NULL,
  `alarm_period` varchar(50) DEFAULT NULL,
  `tenantguid` varchar(50) DEFAULT NULL,
  `projectguid` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`RowGuid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

