DROP TABLE IF EXISTS `oneapm_docker_images_desc`;
CREATE TABLE `oneapm_docker_images_desc` (
  `rowguid` varchar(50) NOT NULL,
  `imagename` varchar(200) DEFAULT NULL,
  `value` text,
  `type` varchar(50) DEFAULT NULL,
  `img` mediumblob,
  PRIMARY KEY (`rowguid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

-- ----------------------------
-- Records of oneapm_docker_images_desc
-- ----------------------------
INSERT INTO `oneapm_docker_images_desc` VALUES ('07bab953-340b-4703-bcf0-2bfc74d0ead9', 'tomcat', 'Tomcat是由Apache软件基金会下属的Jakarta项目开发的一个Servlet容器，按照Sun Microsystems提供的技术规范，实现了对Servlet和JavaServer Page（JSP）的支持，并提供了作为Web服务器的一些特有功能，它也可以被视作一个单独的Web服务器。', 'tomcat', null);
INSERT INTO `oneapm_docker_images_desc` VALUES ('0d22d02e-ef07-4fdf-b817-c20086043008', 'redis', 'Redis是一个开源的使用ANSI C语言编写、支持网络、可基于内存亦可持久化的日志型、Key-Value数据库，并提供多种语言的API。它支持存储的value类型相对更多，包括string(字符串)、list(链表)、set(集合)、zset(sorted set --有序集合)和hash（哈希类型）。这些数据类型都支持push/pop、add/remove及取交集并集和差集及更丰富的操作，而且这些操作都是原子性的。', 'redis', null);
INSERT INTO `oneapm_docker_images_desc` VALUES ('1ca38552-0afc-48e5-95dd-cf37552fe564', 'nginx', 'Nginx（发音同engine x）是一个网页服务器，它能反向代理HTTP, HTTPS, SMTP, POP3, IMAP的协议链接，以及一个负载均衡器和一个HTTP缓存。', 'nginx', null);
INSERT INTO `oneapm_docker_images_desc` VALUES ('82858a47-5407-45dd-96b4-e1409cec7445', 'rabbitmq', 'MQ全称为Message Queue, 消息队列（MQ）是一种应用程序对应用程序的通信方法。MQ是消费-生产者模型的一个典型的代表，一端往消息队列中不断写入消息，而另一端则可以读取队列中的消息。', 'rabbitmq', null);
INSERT INTO `oneapm_docker_images_desc` VALUES ('88ee88ce-2cb2-4e21-8f1b-6d47526da5e1', 'kong', 'Kong是一款基于Nginx_Lua模块写的高可用，易扩展由Mashape公司开源的API Gateway项目。由于Kong是基于Nginx的，所以可以水平扩展多个Kong服务器，通过前置的负载均衡配置把请求均匀地分发到各个Server，来应对大批量的网络请求。', 'kong', null);
INSERT INTO `oneapm_docker_images_desc` VALUES ('9d7167a6-2bc1-4b05-8856-40c5262190b3', 'zookeeper', 'ZooKeeper是一个分布式的，开放源码的分布式应用程序协调服务，是Google的Chubby一个开源的实现，是Hadoop和Hbase的重要组件。它是一个为分布式应用提供一致性服务的软件，提供的功能包括：配置维护、域名服务、分布式同步、组服务等。', 'zookeeper', null);
INSERT INTO `oneapm_docker_images_desc` VALUES ('a215e46c-4750-444d-a4e9-1f5a2759faf8', 'logstash', 'Logstash 是一个开源的数据收集引擎，它具有备实时数据传输能力。它可以统一过滤来自不同源的数据，并按照开发者的制定的规范输出到目的地。', 'logstash', null);
INSERT INTO `oneapm_docker_images_desc` VALUES ('ada44b2e-6bd6-426e-950b-bd3b98871208', 'collectd', '对主机和容器进行性能数据(主机容器状态、cpu占用、内存占用、磁盘占用、网络速率等)的采集，并将数据保存在本地磁盘中，', 'collectd', null);
INSERT INTO `oneapm_docker_images_desc` VALUES ('b14c2841-59a4-11e8-95b1-286ed488c6a6', 'erlang', 'Erlang是一个结构化，动态类型编程语言，内建并行计算支持。最初是由爱立信专门为通信应用设计的，比如控制交换机或者变换协议等，因此非常适 合于构建分布式，实时软并行计算系统。使用Erlang编写出的应用运行时通常由成千上万个轻量级进程组成，并通过消息传递相互通讯。进程间上下文切换对于Erlang来说仅仅 只是一两个环节，比起C程序的线程切换要高效得多得多了。', 'erlang', null);
INSERT INTO `oneapm_docker_images_desc` VALUES ('bb6dbeb7-59a6-11e8-95b1-286ed488c6a6', 'glibc', 'glibc是GNU发布的libc库，即c运行库。glibc是linux系统中最底层的api，几乎其它任何运行库都会依赖于glibc。glibc除了封装linux操作系统所提供的系统服务外，它本身也提供了许多其它一些必要功能服务的实现。由于 glibc 囊括了几乎所有的 UNIX 通行的标准，可以想见其内容包罗万象', 'glibc', null);
INSERT INTO `oneapm_docker_images_desc` VALUES ('bb7cdd62-599d-11e8-95b1-286ed488c6a6', 'postgres', 'PostgreSQL 是一个自由的对象-关系数据库服务器(数据库管理系统)，它在灵活的 BSD-风格许可证下发行。它提供了相对其他开放源代码数据库系统(比如 MySQL 和 Firebird)，和专有系统(比如 Oracle、Sybase、IBM 的 DB2 和 Microsoft SQL Server)之外的另一种选择。', 'postgresql', null);
INSERT INTO `oneapm_docker_images_desc` VALUES ('ca991bb1-59a6-11e8-95b1-286ed488c6a6', 'ldap', 'LDAP是轻量目录访问协议，英文全称是Lightweight Directory Access Protocol，一般都简称为LDAP。它是基于X.500标准的，但是简单多了并且可以根据需要定制。与X.500不同，LDAP支持TCP/IP，这对访问Internet是必须的。LDAP的核心规范在RFC中都有定义，所有与LDAP相关的RFC都可以在LDAPman RFC网页中找到。', 'ldap', null);
INSERT INTO `oneapm_docker_images_desc` VALUES ('d359ef55-5e27-11e8-b044-286ed488c6a6', 'mongodb', 'MongoDB 是一个介于关系数据库和非关系数据库之间的产品，是非关系数据库当中功能最丰富，最像关系数据库的。他支持的数据结构非常松散，是类似json的bson格式，因此可以存储比较复杂的数据类型。', 'mongodb', null);
INSERT INTO `oneapm_docker_images_desc` VALUES ('db841a27-5e27-11e8-b044-286ed488c6a6', 'mysql', 'MySQL是一种关系数据库管理系统，关系数据库将数据保存在不同的表中，而不是将所有数据放在一个大仓库内，这样就增加了速度并提高了灵活性。', 'mysql', null);
INSERT INTO `oneapm_docker_images_desc` VALUES ('db9269ac-59a6-11e8-95b1-286ed488c6a6', 'orange', 'Orange是一个基于组件的数据挖掘和机器学习软件套装，它的功能既友好，又很强大，快速而又多功能的可视化编程前端，以便浏览数据分析和可视化，绑定了 Python以进行脚本开发。它包含了完整的一系列的组件以进行数据预处理，并提供了数据帐目，过渡，建模，模式评估和勘探的功能。基于C++ 和 Python开发，它的图形库是由跨平台的Qt框架开发。', 'orange', null);
INSERT INTO `oneapm_docker_images_desc` VALUES ('eb9cc3aa-862d-48ec-b695-9e80a8b0a643', 'openresty', 'OpenResty是一个基于 Nginx 与 Lua 的高性能 Web 平台，其内部集成了大量精良的 Lua 库、第三方模块以及大多数的依赖项。用于方便地搭建能够处理超高并发、扩展性极高的动态 Web 应用、Web 服务和动态网关。', 'openresty', null);
INSERT INTO `oneapm_docker_images_desc` VALUES ('fd719e9a-4dce-4fe5-8ae1-1ea9e0b0d827', 'solr', 'Solr是一个独立的企业级搜索应用服务器，它对外提供类似于Web-service的API接口。用户可以通过http请求，向搜索引擎服务器提交一定格式的XML文件，生成索引；也可以通过Http Get操作提出查找请求，并得到XML格式的返回结果。', 'solr', null);

