INSERT INTO `oneapm_ectransfer_method` VALUES (null, null, null, null, null, '07acd810-66b2-4cac-8804-8550c02f0651', 'oracle', 'oracle', 'create or replace procedure proc_oracle_status_v2(\r\n  tempcursor OUT SYS_REFCURSOR\r\n)\r\nas\r\n  --基本信息\r\n  v_name_instance varchar2(44);\r\n  v_dbid number;\r\n  v_name_unique varchar2(44);\r\n  v_created_time varchar2(40);\r\n  v_platform_name varchar2(30);\r\n  v_current_scn number;\r\n  v_log_mode varchar2(30);\r\n  v_open_mode varchar2(30);\r\n  v_force_logging varchar2(44);\r\n  v_flashback_on varchar2(20);\r\n  v_database_role varchar2(20);\r\n  v_version varchar2(20);\r\n  v_character varchar2(50);\r\n  v_israc varchar2(20);\r\n  v_isdg varchar2(20);\r\n  v_dgrole varchar2(20);\r\n  v_lock varchar2(20);\r\n  \r\n  --会话数和进程数\r\n  cursor c_cursor1 is select trim(RESOURCE_NAME) RESOURCE_NAME,trim(CURRENT_UTILIZATION) CURRENT_UTILIZATION,trim(MAX_UTILIZATION) MAX_UTILIZATION,trim(INITIAL_ALLOCATION) INITIAL_ALLOCATION,trim(LIMIT_VALUE) LIMIT_VALUE from v$resource_limit;\r\n  v_processes varchar2(200);\r\n  v_sessions varchar2(200);\r\n  \r\n  --内存信息\r\n  cursor c_cursor2 is select name,value from v$parameter where name in(\'memory_target\',\'memory_max_target\',\'sga_target\',\'sga_max_size\',\'pga_aggregate_target\');\r\n  v_memory_info varchar(200) :=\'\';\r\n  \r\n  --SGA信息\r\n  cursor c_cursor3 is SELECT i.instance_name instance_name,s.name name,s.BYTES value FROM gv$sgainfo s,gv$instance i WHERE s.inst_id = i.inst_id ORDER BY i.instance_name;\r\n  v_sga_info varchar(400) :=\'\';\r\n  \r\n  --表空间信息\r\n  cursor c_cursor4 is SELECT DECODE(d.status,\r\n              \'OFFLINE\',\r\n              d.status ,\r\n              d.status ) status,\r\n       d.tablespace_name  name,\r\n       d.contents type,\r\n       d.bigfile,\r\n       d.extent_management extent_mgt,\r\n       d.segment_space_management segment_mgt,\r\n       round(NVL(a.bytes, 0), 2) ts_size,\r\n       round(NVL(f.bytes, 0) , 2) free,\r\n       round(NVL(a.bytes - NVL(f.bytes, 0), 0) , 2) used,\r\n       round(100 - ((round(NVL(f.bytes, 0) , 2) / round(NVL(a.bytes, 0), 2)) * 100)) pct_used\r\n  FROM sys.dba_tablespaces d,\r\n       (select tablespace_name, sum(bytes) bytes\r\n          from dba_data_files\r\n         group by tablespace_name) a,\r\n       (select tablespace_name, sum(bytes) bytes\r\n          from dba_free_space\r\n         group by tablespace_name) f\r\n WHERE d.tablespace_name = a.tablespace_name(\\+)\r\n   AND d.tablespace_name = f.tablespace_name(\\+)\r\n   AND NOT\r\n        (d.extent_management like \'LOCAL\' AND d.contents like \'TEMPORARY\')\r\nUNION ALL\r\nSELECT DECODE(d.status,\r\n              \'OFFLINE\',\r\n               d.status ,\r\n               d.status\r\n             ) status,\r\n       d.tablespace_name name,\r\n       d.contents type, \r\n       d.bigfile,\r\n       d.extent_management extent_mgt,\r\n       d.segment_space_management segment_mgt,\r\n       round(NVL(a.bytes, 0) , 2) ts_size,\r\n       round(NVL(a.bytes - NVL(t.bytes, 0), 0) , 2) free,\r\n       round(NVL(t.bytes, 0) / 4424 / 4424, 2) used,\r\n       round(100 - ((round(NVL(a.bytes - NVL(t.bytes, 0), 0) , 2) / round(NVL(a.bytes, 0) , 2)) * 100)) pct_used\r\n  FROM sys.dba_tablespaces d,\r\n       (select tablespace_name, sum(bytes) bytes\r\n          from dba_temp_files\r\n         group by tablespace_name) a,\r\n       (select tablespace_name, sum(bytes_cached) bytes\r\n          from v$temp_extent_pool\r\n         group by tablespace_name) t\r\n WHERE d.tablespace_name = a.tablespace_name(\\+)\r\n   AND d.tablespace_name = t.tablespace_name(\\+)\r\n   AND d.extent_management like \'LOCAL\'\r\n   AND d.contents like \'TEMPORARY\'\r\n ORDER BY 2;\r\n  v_tablespace_info varchar2(2000) :=\'\';\r\n  \r\n  --参数信息\r\n  cursor c_cursor5 is \r\n    select DECODE(isdefault\r\n            , \'FALSE\'\r\n            ,  SUBSTR(name,0,512) \r\n            , SUBSTR(name,0,512) ) pname\r\n  , DECODE(   isdefault\r\n            , \'FALSE\'\r\n            ,  SUBSTR(value,0,512)\r\n            , SUBSTR(value,0,512) ) value           \r\n ,DECODE(   isdefault\r\n            , \'FALSE\'\r\n            ,  isdefault\r\n            , isdefault ) isdefault\r\n  , DECODE(   isdefault\r\n            , \'FALSE\'\r\n            ,  issys_modifiable \r\n            ,  issys_modifiable )  issys_modifiable,\r\n  ISDEPRECATED,  \r\n  DESCRIPTION\r\n  \r\nFROM\r\n    v$parameter \r\nWHERE name in (\'background_dump_dest\',\'cluster_database\',\'compatible\',\'control_file_record_keep_time\',\r\n        \'control_files\',\'cursor_sharing\',\'db_block_size\',\'db_files\',\'db_file_multiblock_read_count\',\'db_name\',\r\n        \'db_recovery_file_dest\',\'db_recovery_file_dest_size\',\'db_unique_name\',\'log_buffer\',\'nls_language\',\'open_cursors\',\'optimizer_mode\',\'processes\',\'sort_area_size\',\'spfile\',\'undo_retention\')\r\nORDER BY\r\n    name;\r\n  v_parameter_info varchar2(4000) :=\'\'; \r\n  \r\n  \r\nbegin\r\n\r\n  --取实例基本信息\r\n  begin\r\n     SELECT NAME,dbid,db_unique_name,TO_CHAR(created, \'yyyy-mm-dd HH24:MI:SS\'),platform_name,current_scn,log_mode,open_mode,force_logging,flashback_on,DATABASE_ROLE\r\n         into v_name_instance,v_dbid,v_name_unique,v_created_time,v_platform_name,v_current_scn,v_log_mode,v_open_mode,v_force_logging,v_flashback_on,v_database_role\r\n     FROM v$database ;\r\n     select version into v_version from v$instance;\r\n     select userenv(\'LANGUAGE\') into v_character from dual;\r\n  select value into v_israc from v$option WHERE Parameter = \'Real Application Clusters\';\r\n  select count(*) into v_lock from v$locked_object;\r\n   if v_israc=\'FALSE\' then\r\n     v_israc:=\'NO\';\r\n  else \r\n     v_israc:=\'YES\';\r\n   end if;\r\n   select case when d.VALUE is null then \'NULL\' else d.VALUE end DGINFO into v_isdg FROM v$parameter d WHERE d.NAME = \'log_archive_config\';\r\n     if v_isdg=\'NULL\' then \r\n     v_dgrole:=\'UNUSE\';\r\n  else \r\n     select database_role into v_dgrole from v$database;\r\n     end if;\r\n  exception\r\n     when no_data_found then \r\n     dbms_output.put_line(\'未取到相应值，请处理\');\r\n  end;\r\n  --输出测试\r\n  dbms_output.put_line(\'name:\'||v_name_instance||chr(44)||\'DBID:\'||v_dbid||chr(44)||\'unique_name:\'||v_name_unique);\r\n  dbms_output.put_line(\'version:\'||v_version);\r\n  dbms_output.put_line(\'character:\'||v_character);\r\n  \r\n  --取会话数和进程数\r\n  for cur in c_cursor1 loop\r\n       if cur.resource_name = \'processes\' then \r\n         v_processes :=\'current:\'||to_char(cur.current_utilization) ||chr(44)||\'initial:\' ||to_char(cur.initial_allocation);\r\n       elsif cur.resource_name = \'sessions\' then\r\n         v_sessions :=\'current:\'||to_char(cur.current_utilization) ||chr(44)||\'initial:\' ||to_char(cur.initial_allocation); \r\n       end if;\r\n  end loop; \r\n  --输出测试    \r\n  dbms_output.put_line(v_processes);\r\n  dbms_output.put_line(v_sessions);\r\n  \r\n  --获取内存信息\r\n  for cur in c_cursor2 loop\r\n      v_memory_info := v_memory_info||cur.name||chr(58)||to_char(cur.value)||chr(44);\r\n  end loop;\r\n    --输出测试 \r\n  dbms_output.put_line(v_memory_info);\r\n  \r\n  --获取SGA信息\r\n  for cur in c_cursor3 loop\r\n      v_sga_info := v_sga_info||cur.name||chr(58)||to_char(cur.value)||chr(44);\r\n  end loop;\r\n  --输出测试 \r\n  dbms_output.put_line(v_sga_info);\r\n  \r\n  --获取表空间信息\r\n  for cur in c_cursor4 loop\r\n      v_tablespace_info := v_tablespace_info||cur.name||chr(58)||to_char(cur.status)||chr(58)||to_char(cur.type)||chr(58)||to_char(cur.ts_size)||chr(58)||to_char(cur.free)||chr(58)||to_char(cur.used)||chr(58)||to_char(cur.pct_used)||chr(44);\r\n  end loop;\r\n  --输出测试 \r\n  dbms_output.put_line(v_tablespace_info);\r\n  \r\n    --获取参数信息\r\n  for cur in c_cursor5 loop\r\n    v_parameter_info := v_parameter_info||to_char(cur.pname)||chr(58)||to_char(cur.value)||chr(58)||to_char(cur.isdefault)||chr(58)||to_char(cur.issys_modifiable)||chr(58)||to_char(cur.ISDEPRECATED)||chr(58)||to_char(cur.DESCRIPTION)||chr(44);\r\n    --v_parameter_info := v_parameter_info||to_char(cur.value)||chr(44);\r\n  end loop;\r\n   --输出测试 \r\n  dbms_output.put_line(v_parameter_info); \r\n  \r\n  open tempcursor for select v_israc as \"israc\",v_dgrole as \"dgrole\",v_name_instance as \"name\",v_dbid as \"DBID\",v_name_unique as \"unique_name\",v_version as \"version\",v_log_mode as \"log_mode\",v_character as \"character\",v_processes as \"processes\",v_sessions as \"sessions\",v_memory_info as \"v_memory_info\",v_sga_info as \"sga_info\",v_tablespace_info as \"tablespace_info\",v_parameter_info as \"parameter_info\",v_lock as \"lock\" from dual;\r\nend;', 'resultset', null, null);
INSERT INTO `oneapm_ectransfer_method` VALUES (null, null, null, null, null, '80fec652-ac3d-42b2-a08c-c2e5c502331c', 'mysql', 'mysql', 'CREATE PROCEDURE PROC_EPOINT_MYSQL_STATUS_V1()\r\nBEGIN\r\n     DECLARE con_max, con_now, rd_only, gtid_mode, slow_query, log_output varchar(100);\r\n     DECLARE bp_num, bp_sz,lgc_read, phy_read VARCHAR(100);\r\n     DECLARE bp_page_data, bp_page_dirty, bp_page_flushed, bp_page_free, bp_page_misc, bp_page_total VARCHAR(100);\r\n     DECLARE innodb_delete, innodb_insert, innodb_select, innodb_update VARCHAR(100);\r\n     DECLARE cmd_delete, cmd_insert, cmd_select, cmd_update,cmd_commit,cmd_rbk,query_num VARCHAR(100);\r\n     DECLARE db_names text default \'\';\r\n     DECLARE cursor_stop int default 0;\r\n     DECLARE version varchar(100);\r\n     DECLARE table_info, db_temp, table_temp, size_temp MEDIUMTEXT default \'\';\r\n     DECLARE master_host_ip, repl_delay, bin_name, bin_pos varchar(100) default \'N/A\';\r\n  DECLARE mysql_role varchar(32);\r\n\r\n     \r\n     \r\n   -- cursor_1 for con_max,  bp_num, bp_sz, rdro, gtid_mode\r\n     DECLARE cursor_1 CURSOR FOR SELECT \r\n   variable_value\r\n   FROM\r\n   information_schema.global_variables\r\n  WHERE\r\n    variable_name IN (\'MAX_CONNECTIONS\',\r\n        \'INNODB_BUFFER_POOL_INSTANCES\' , \r\n        \'INNODB_BUFFER_POOL_SIZE\',\r\n        \'READ_ONLY\',\'GTID_MODE\',\r\n        \'LOG_OUTPUT\', \'SLOW_QUERY_LOG\')\r\n   ORDER BY variable_name;\r\n     \r\n     \r\n     -- cursor_2 for con_now, bp_num, bp_sz,lgc_read, phy_read,\r\n     --              bp_page_data, bp_page_dirty, bp_page_flushed, bp_page_free, bp_page_misc, bp_page_total\r\n     --              innodb_delete, innodb_insert, innodb_select, innodb_update\r\n     DECLARE cursor_2 CURSOR FOR SELECT \r\n        variable_value\r\n   FROM\r\n        information_schema.global_status\r\n     WHERE\r\n        variable_name IN (\'THREADS_CONNECTED\',\r\n            \'INNODB_BUFFER_POOL_READ_REQUESTS\', \'INNODB_BUFFER_POOL_READS\',\r\n      \'INNODB_BUFFER_POOL_PAGES_TOTAL\', \'INNODB_BUFFER_POOL_PAGES_DATA\', \r\n            \'INNODB_BUFFER_POOL_PAGES_DIRTY\', \'INNODB_BUFFER_POOL_PAGES_FLUSHED\',\r\n        \'INNODB_BUFFER_POOL_PAGES_MISC\', \'INNODB_BUFFER_POOL_PAGES_FREE\',\r\n            \'INNODB_ROWS_READ\' , \'INNODB_ROWS_INSERTED\',\r\n            \'INNODB_ROWS_DELETED\',\'INNODB_ROWS_UPDATED\',\r\n            \'COM_SELECT\', \'COM_INSERT\', \'COM_DELETE\', \'COM_UPDATE\', \'QUERIES\',\r\n            \'COM_COMMIT\', \'COM_ROLLBACK\')\r\n     ORDER BY variable_name;\r\n  \r\n    \r\n     -- cursror_3 for db table size\r\n     DECLARE cursor_3 CURSOR FOR SELECT \r\n        tb.table_schema,\r\n        tb.table_name,\r\n        (IFNULL(tb.index_length, 0) + IFNULL(tb.data_length, 0)) AS size\r\n  FROM\r\n        information_schema.TABLES AS tb,\r\n        information_schema.SCHEMATA AS db\r\n     WHERE\r\n        schema_name NOT IN (\'information_schema\' , \'mysql\', \'performance_schema\', \'sys\')\r\n        AND tb.table_schema = db.schema_name\r\n        AND table_type = \'BASE TABLE\';\r\n     \r\n  DECLARE CONTINUE HANDLER FOR NOT FOUND SET cursor_stop := null;\r\n \r\n     -- con_max, bp_num, bp_sz, rdro, gtid_mode\r\n   open cursor_1;\r\n         fetch cursor_1 into gtid_mode;\r\n         fetch cursor_1 into bp_num;\r\n         fetch cursor_1 into bp_sz;\r\n         fetch cursor_1 into log_output;\r\n         fetch cursor_1 into con_max;\r\n         fetch cursor_1 into rd_only;\r\n         fetch cursor_1 into slow_query;\r\n  close cursor_1;\r\n\r\n\r\n   -- con_now,lgc_read, phy_read\r\n     -- bp_page_data, bp_page_dirty, bp_page_flushed, bp_page_free, bp_page_misc, bp_page_total\r\n     -- innodb_delete, innodb_insert, innodb_select, innodb_update\r\n     -- cmd_delete, cmd_insert, cmd_select, cmd_update,cmd_commit,cmd_rbk,qps, con_now\r\n     \r\n     open cursor_2;\r\n         fetch cursor_2 into cmd_commit;\r\n         fetch cursor_2 into cmd_delete;\r\n         fetch cursor_2 into cmd_insert;\r\n         fetch cursor_2 into cmd_rbk;\r\n         fetch cursor_2 into cmd_select;\r\n         fetch cursor_2 into cmd_update;\r\n         fetch cursor_2 into bp_page_data;\r\n         fetch cursor_2 into bp_page_dirty;\r\n         fetch cursor_2 into bp_page_flushed;\r\n         fetch cursor_2 into bp_page_free;\r\n         fetch cursor_2 into bp_page_misc;\r\n         fetch cursor_2 into bp_page_total;\r\n         fetch cursor_2 into phy_read;\r\n         fetch cursor_2 into lgc_read;\r\n         fetch cursor_2 into innodb_delete;\r\n         fetch cursor_2 into innodb_insert;\r\n         fetch cursor_2 into innodb_select;\r\n         fetch cursor_2 into innodb_update;\r\n         fetch cursor_2 into query_num;\r\n         fetch cursor_2 into con_now;\r\n  close cursor_2;\r\n\r\n     -- for db:table:size\r\n     SET cursor_stop := 1;\r\n  open cursor_3;\r\n    FETCH cursor_3 INTO db_temp, table_temp, size_temp;\r\n         -- set table_info := concat(db_temp, \":\", table_temp, \":\" ,size_temp);\r\n    WHILE (  cursor_stop is not null ) DO \r\n           set table_info := concat(table_info,\",\", db_temp, \":\", table_temp, \":\" ,size_temp);\r\n           FETCH cursor_3 INTO db_temp, table_temp, size_temp;\r\n         END WHILE;\r\n     close cursor_3;\r\n     \r\n     SELECT MID(table_info,2) INTO table_info;\r\n\r\n     -- for db_names\r\n     SELECT \r\n     group_concat(schema_name) into db_names\r\n  FROM\r\n     information_schema.SCHEMATA\r\n  WHERE\r\n    schema_name NOT IN (\'information_schema\' , \'mysql\', \'performance_schema\', \'sys\') \r\n  ORDER BY schema_name;\r\n\r\n\r\n     -- for version\r\n  SELECT version() into version;\r\n     \r\n     -- for master_host\r\n     SELECT Host into master_host_ip from mysql.slave_master_info;\r\n\r\n     -- for mysql_role\r\n     IF master_host_ip is null or master_host_ip=\'N/A\' then\r\n         set mysql_role:= \'Master\';\r\n  ELSE \r\n         set mysql_role:= \'Slave\';\r\n         select Master_log_name, Master_log_pos, Sql_delay into  bin_name, bin_pos, repl_delay from mysql.slave_relay_log_info;\r\n  END IF;\r\n     \r\n     \r\n   -- get result\r\n     SELECT version, mysql_role, con_max , con_now, bp_num, bp_sz, lgc_read, phy_read, rd_only, gtid_mode, slow_query, log_output,\r\n            bp_page_data, bp_page_dirty, bp_page_flushed, bp_page_free, bp_page_misc, bp_page_total,\r\n            innodb_delete, innodb_insert, innodb_select, innodb_update,\r\n            cmd_delete, cmd_insert, cmd_select, cmd_update,cmd_commit,cmd_rbk,query_num, cmd_commit+cmd_rbk as tx_num,\r\n            db_names, table_info, master_host_ip, bin_name, bin_pos, repl_delay;\r\n\r\nEND;', 'resultset', '', null);
