INSERT INTO `oneapm_ectransfer_method` VALUES (null, null, null, null, null, 'b59e3a0d-192d-4c40-89a3-6b52c49da3db', 'mssql', 'mssql', 'create procedure proc_mssql_status_v2\r\nas\r\ndeclare\r\n@v_lock_time  bigint,\r\n@v_lock_freq  bigint,\r\n@v_lock_num   bigint,\r\n@v_log_size  bigint,\r\n@v_log_used   bigint,\r\n@v_mem_sql_used  bigint,\r\n@v_mem_sql_free  bigint,\r\n@v_exec_sql_err  int,\r\n\r\n@instance_name_1  char(100),\r\n@instance_name_2  char(100),\r\n@cntr_value_1  nvarchar(50),\r\n@cntr_value_2  nvarchar(50),\r\n@sqlnameb nvarchar(2000),\r\n@request int,\r\n@conn int,\r\n@maxconn1 int,\r\n@maxconn2 int, \r\n@cntr1 nvarchar(2000),\r\n@cntr2 nvarchar(2000),\r\n@process int,\r\n@process_current int,\r\n@process_wait int,\r\n@session int,\r\n@version nvarchar(31),\r\n@deadlock int\r\n\r\nset @cntr1=\'\'\r\nset @cntr2=\'\'\r\nbegin\r\n/*cur_1:库日志文件大小*/\r\ndeclare cur_1 cursor for select instance_name,convert(varchar(100),cntr_value*1024) as cntrstr from sys.dm_os_performance_counters where counter_name=\'Log File(s) Size (KB)\' and instance_name not in (\'master\', \'model\',\'msdb\',\'tempdb\',\'ReportServer\',\'ReportServerTempDB\',\'mssqlsystemresource\',\'_Total\');\r\nopen cur_1\r\nfetch next from cur_1 into  @instance_name_1,@cntr_value_1\r\nwhile (@@fetch_status = 0)\r\n  begin\r\n  set @cntr1 +=LTrim(RTrim(@instance_name_1)) +\':\'+ @cntr_value_1+\';\'\r\n  fetch next from cur_1 into  @instance_name_1,@cntr_value_1\r\n  end\r\nclose cur_1  \r\nDEALLOCATE cur_1\r\n --select @cntr1 as log_size\r\n/*cur_1:库日志已使用大小*/\r\ndeclare cur_2 cursor for select instance_name,convert(varchar(100),cntr_value*1024) from sys.dm_os_performance_counters where counter_name=\'Log File(s) Used Size (KB)\' and instance_name not in (\'master\', \'model\',\'msdb\',\'tempdb\',\'ReportServer\',\'ReportServerTempDB\',\'mssqlsystemresource\',\'_Total\');\r\nopen cur_2\r\nfetch next from cur_2 into  @instance_name_2,@cntr_value_2\r\nwhile (@@fetch_status = 0)\r\n  begin\r\n  set @cntr2 +=LTrim(RTrim(@instance_name_2)) +\':\'+ @cntr_value_2+\';\'\r\n  fetch next from cur_2 into  @instance_name_2,@cntr_value_2\r\n  end\r\nclose cur_2  \r\nDEALLOCATE cur_2\r\n --select @cntr2 as log_size_used\r\n\r\n/*锁时间*/\r\nselect @v_lock_time=cntr_value from sys.dm_os_performance_counters where counter_name=\'Lock Waits/sec\' and instance_name=\'_Total\'\r\n/*锁频率*/\r\nselect @v_lock_freq=cntr_value from sys.dm_os_performance_counters where counter_name=\'Average Wait Time (ms)\' and instance_name=\'_Total\'\r\n/*锁数量*/\r\nselect @v_lock_num=count(*) from sys.dm_tran_locks\r\n/*死锁数量*/\r\nselect @deadlock=cntr_value FROM sys.dm_os_performance_counters WHERE counter_name like \'Number of Deadlock%\' and instance_name = \'_Total\'\r\n/*日志文件大小*/\r\nselect @v_log_size=cntr_value*1024  from sys.dm_os_performance_counters where counter_name=\'Log File(s) Size (KB)\' and instance_name=\'_Total\'\r\n/*日志已使用大小*/\r\nselect @v_log_used=cntr_value*1024 from  sys.dm_os_performance_counters where counter_name=\'Log File(s) Used Size (KB)\' and instance_name=\'_Total\'\r\n/*SQL内存使用大小*/\r\nselect  @v_mem_sql_used=cntr_value*1024  from sys.dm_os_performance_counters where counter_name=\'Total Server Memory (KB)\'\r\n/*SQL内存未使用大小*/\r\nselect  @v_mem_sql_free=cntr_value*1024  from sys.dm_os_performance_counters where counter_name=\'Target Server Memory (KB)\'\r\n/*SQL执行出错数*/\r\nselect  @v_exec_sql_err=cntr_value from sys.dm_os_performance_counters where counter_name=\'Errors/sec\' and instance_name=\'User Errors\'\r\n/*当前请求数*/\r\nselect @request=cntr_value from sys.dm_os_performance_counters where counter_name=\'Batch Requests/sec\' \r\n/*当前连接数*/\r\nSELECT @conn=COUNT(*) FROM sys.dm_exec_connections\r\n/*最大连接数*/\r\nselect @maxconn1=value from  master.dbo.sysconfigures where [config]=103\r\nif @maxconn1=0\r\nbegin\r\nset @maxconn2=32767\r\nend \r\nelse\r\nbegin\r\nset @maxconn2=@maxconn1\r\nend\r\n\r\n/*进程数*/\r\nselect @process=COUNT(*) from master.dbo.sysprocesses\r\n/*运行进程数*/\r\nselect @process_current=COUNT(*) from master.dbo.sysprocesses where status in (\'running\',\'background\')\r\n/*等待进程数*/\r\nselect @process_wait=COUNT(*) from master.dbo.sysprocesses where status in (\'runnable\',\'suspended\')\r\n/*版本*/\r\nselect @version=@@version\r\n/*会话数*/\r\nselect @session=COUNT(*) from sys.dm_exec_sessions\r\n\r\nselect @cntr1 as log_size,@cntr2 as log_size_used,@maxconn2 as maxconn,@conn as conn,@request as request,@v_exec_sql_err as v_exec_sql_err,@v_mem_sql_free as v_mem_sql_free,@v_mem_sql_used as v_mem_sql_used,@v_log_used as v_log_used,@v_log_size as v_log_size,@v_lock_freq as v_lock_freq,@v_lock_time as v_lock_time,@v_lock_num as v_lock_num,@process as process,@process_current as process_current,@process_wait as process_wait,@version as version,@session as session,@deadlock as deadlock\r\nend', 'resultset', null, null);
